//     description:
//       'وصف مختصر لمشروع تحويل النفايات إلى طاقة بوتاجاز\n مشروع تحويل النفايات إلى طاقة بوتاجاز يهدف إلى معالجة النفايات العضوية بطريقة مستدامة وفعالة بيئيًا. يعتمد المشروع على استخدام تقنيات فيزيائية وكيميائية لتحويل النفايات، مثل بقايا الطعام والمخلفات الزراعية، إلى غاز الميثان القابل للاستخدام في الطهي، وبالتالي تقليل الاعتماد على الغاز الطبيعي والحد من تلوث البيئة.\n',
//     _id: '79278ee0-2586-4878-b8cb-c905e2f76dfb',
//     _owner: 'ed2e06cf-ae51-496a-8d6a-f2c123d93978',
