//     teacherid: '1a8147a8-62ac-4359-b064-0d3f07d30c38',
//     objectives:
//       '<ul class="font_8">\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تعزيز الفهم العلمي لمفاهيم التحلل البيولوجي:</strong>يتعلم الطلاب عن <strong>عملية التحلل اللاهوائي</strong> التي تحول المواد العضوية إلى غاز الميثان. من خلال بناء نموذج باستخدام قطع ليغو، يتمكن الطلاب من تصور كيفية تحويل النفايات إلى طاقة بطريقة مبسطة وواضحة.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تعليم تقنيات الطاقة المتجددة:</strong>يساهم المشروع في تعريف الطلاب بمفاهيم الطاقة المتجددة واستخدام الغاز الحيوي (الميثان) كبديل للطاقة التقليدية. مما يساعدهم على فهم أهمية البحث عن حلول للطاقة المستدامة في عالم يعاني من أزمة الطاقة.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تعزيز التفكير الهندسي والإبداعي:</strong>من خلال تصميم النموذج باستخدام قطع ليغو، يتعلم الطلاب كيفية <strong>التخطيط</strong> و<strong>تصميم الأنظمة المعقدة</strong> من خلال أدوات بسيطة. يساعد هذا في تطوير مهاراتهم الهندسية والإبداعية في حل المشكلات وتطبيق المفاهيم العلمية في سياق عملي.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تعليم مفاهيم إعادة التدوير وإدارة النفايات:</strong>المشروع يبرز أهمية <strong>إعادة تدوير النفايات</strong> واستخدام المخلفات بشكل إيجابي، مما يساعد الطلاب على فهم دورهم في الحد من التلوث والحفاظ على البيئة من خلال تحويل النفايات إلى مصادر طاقة مفيدة.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تعزيز مهارات العمل الجماعي والتعاون:</strong>يتطلب بناء النموذج واختبار النظام العمل في مجموعات. من خلال ذلك، يطور الطلاب <strong>مهارات التعاون والتواصل</strong> مع زملائهم في الفريق لتحقيق الأهداف المشتركة.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تحفيز التفكير النقدي وحل المشكلات:</strong>أثناء تنفيذ المشروع، سيواجه الطلاب العديد من التحديات التقنية أو التصميمية. سيحفز ذلك <strong>التفكير النقدي</strong> لدى الطلاب، حيث سيحتاجون إلى التفكير في حلول إبداعية لتطوير وتحسين النموذج.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تعليم مفاهيم الاستدامة والبيئة:</strong>من خلال هذا المشروع، يتعرف الطلاب على أهمية <strong>الاستدامة البيئية</strong> وكيف يمكن للأفكار والتكنولوجيا أن تساهم في تحسين البيئة وتقليل تأثير النفايات على الكوكب. يتعلمون أهمية التفكير المستدام في تصميم المشاريع المستقبلية.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>تعزيز مهارات التواصل والعرض:</strong>عندما يقدم الطلاب مشروعهم أمام الآخرين، سواء كان المعلم أو زملائهم، يتعلمون كيفية <strong>التواصل الفعال</strong> وشرح الأفكار التقنية والبيئية بطريقة بسيطة وواضحة. يمكنهم تحسين مهارات العرض والإقناع من خلال شرح كيفية عمل النموذج وفوائده.<br>\n</p></li>\n  <li style="text-align: right" dir="RTL"><p dir="RTL" class="font_8" style="text-align: right"><strong>إيجاد رابط بين العلم والحياة اليومية:</strong>هذا المشروع يعزز الرابط بين <strong>المفاهيم العلمية</strong> وحياة الطلاب اليومية، حيث يرون كيف يمكن تطبيق العلوم في حل مشكلات حقيقية مثل إدارة النفايات وإنتاج الطاقة بشكل مستدام.<br>\n</p></li>\n</ul>',
